import React from "react";
import { useSelector, useDispatch } from "react-redux";

import {
  AiOutlinePlusCircle,
  AiOutlineMinusCircle,
  AiOutlineClear,
} from "react-icons/ai";

const Counter = () => {
  var count = useSelector((state) => state.value);

  return (
    <p>
      Cliques: {count} vezes <AiOutlinePlusCircle /> <AiOutlineMinusCircle />{" "}
      <AiOutlineClear />
    </p>
  );
};

export default Counter;
